pragma solidity ^0.4.24;
import "./SupplyChainUser.sol";
import "./Ownable.sol";

contract FoodSupplyChain is Ownable
{
    SupplyChainUser supplyChainUser;

    constructor(address _supplyChainUser) public {
        supplyChainUser = SupplyChainUser(_supplyChainUser);
    }

    event AuthorizedCaller(address caller);
    event DeAuthorizedCaller(address caller);
    event PerformCultivation(address indexed user, address indexed batchNo);
    event DoneInspection(address indexed user, address indexed batchNo);
    event DoneProducing(address indexed user, address indexed batchNo);

    /*Modifier*/
    modifier isValidPerformer(address batchNo, string role) {
        require(keccak256(abi.encodePacked(supplyChainUser.getUserRole(msg.sender))) == keccak256(abi.encodePacked(role)));
        require(keccak256(abi.encodePacked(getNextAction(batchNo))) == keccak256(abi.encodePacked(role)));
        _;
    }

    /*User Roles
        SUPER_ADMIN,
        FARM_INSPECTION,
        PRODUCER,
        EXPORTER,
        CARRIER,
        DISTRIBUTOR,
        PROCESSOR,
        RETAILER
    */

        /* Process Related */
     struct basicDetails {
        string foodName;      
        string registrationNo;
        string farmerName;
        string farmAddress;
        string exporterName;
        string carrierName;
    }

    struct farmInspector {
        string soilType;
        string typeOfSeed;
        string fertilizerUsed;
        string processName;
        string certificateNumber;
    }

    struct producer {
        string cropVariety;
        string temperatureUsed;
        string humidity;
    }    

    mapping (address => basicDetails) batchBasicDetails;
    mapping (address => farmInspector) batchFarmInspector;
    mapping (address => producer) batchProducer;
    mapping (address => string) nextAction;

    /*Initialize struct pointer*/
    basicDetails basicDetailsData;
    farmInspector farmInspectorData;
    producer producerData;

    /* Get Next Action  */    
    function getNextAction(address _batchNo) public view returns(string action){
       return nextAction[_batchNo];
    }

    function setNextAction(address _batchNo, string _action) public {
        nextAction[_batchNo] = _action;
    }

    /* get Basic Details */
    function getBasicDetails(address _batchNo) public view returns (string registrationNo,
                                                               string foodName,
                                                               string farmerName,
                                                               string farmAddress,
                                                               string exporterName,
                                                               string carrierName) {
        /* Call Storage Contract */
        basicDetails memory tmpData = batchBasicDetails[_batchNo];

        return (tmpData.registrationNo,
                tmpData.foodName,
                tmpData.farmerName,
                tmpData.farmAddress,
                tmpData.exporterName,
                tmpData.carrierName);
    }

    /* perform Basic Cultivation */
    function addBasicDetails(string _registrationNo,
                             string _foodName,    
                             string _farmerName,
                             string _farmAddress,
                             string _exporterName,
                             string _carrierName
                            ) public onlyOwner returns(bool) {

        uint tmpData = uint(keccak256(abi.encodePacked(msg.sender, now)));
        address batchNo = address(tmpData);

        basicDetailsData.registrationNo = _registrationNo;
        basicDetailsData.foodName = _foodName;
        basicDetailsData.farmerName = _farmerName;
        basicDetailsData.farmAddress = _farmAddress;
        basicDetailsData.exporterName = _exporterName;
        basicDetailsData.carrierName = _carrierName;

        batchBasicDetails[batchNo] = basicDetailsData;

        nextAction[batchNo] = 'FARM_INSPECTION';   

        emit PerformCultivation(msg.sender, batchNo); 

        return true;
    }                            

    /* get Farm Inspection */
    function getFarmInspectorData(address _batchNo) public view returns (string soilType,
                                                                    string typeOfSeed,
                                                                    string fertilizerUsed,
                                                                    string processName,
                                                                    string certificateNumber) {
        farmInspector memory tmpData = batchFarmInspector[_batchNo];
        return (tmpData.soilType, tmpData.typeOfSeed, tmpData.fertilizerUsed, tmpData.processName, tmpData.certificateNumber);
    }

    /* perform Farm Inspection */
    function updateFarmInspectorData(address _batchNo,
                                    string _soilType,
                                    string _typeOfSeed,
                                    string _fertilizerUsed,
                                    string _processName,
                                    string _certificateNumber) 
                                public isValidPerformer(_batchNo,'FARM_INSPECTION') returns(bool) {
        farmInspectorData.soilType = _soilType;
        farmInspectorData.typeOfSeed = _typeOfSeed;
        farmInspectorData.fertilizerUsed = _fertilizerUsed;
        farmInspectorData.processName = _processName;
        farmInspectorData.certificateNumber = _certificateNumber;

        batchFarmInspector[_batchNo] = farmInspectorData;

        nextAction[_batchNo] = 'PRODUCER';   

        emit DoneInspection(msg.sender, _batchNo);
        return true;
    }

    /*get farm Harvester data*/
    function getProducerData(address batchNo) public view returns(string cropVariety,
                                                             string temperatureUsed,
                                                             string humidity){

        producer memory tmpData = batchProducer[batchNo];
        return (tmpData.cropVariety, tmpData.temperatureUsed, tmpData.humidity);
    }

    /*set Producer data*/
    function updateProducerData(address _batchNo,
                              string _cropVariety,
                              string _temperatureUsed,
                              string _humidity) public isValidPerformer(_batchNo,'PRODUCER') returns(bool){

        producerData.cropVariety = _cropVariety;
        producerData.temperatureUsed = _temperatureUsed;
        producerData.humidity = _humidity;

        batchProducer[_batchNo] = producerData;

        nextAction[_batchNo] = 'EXPORTER';  

        emit DoneProducing(msg.sender, _batchNo);
        return true;
    }    

}
